import React from 'react';
import './styles.css';
import Pulse from 'react-reveal/Pulse';

export default class SkillBox extends React.Component {
    render() {
        return (
            <div>
                <Pulse>
                    <img src={this.props.src} className="skillImage"/>
                    <h4 className="skillName"></h4>
                </Pulse>
            </div>
        )
    }
}
